import React from 'react';
import ProjectComponent from "./Components/ProjectComponent";
import airplane from './PaperAirplane.svg';

function Projects(props) {
    return (
        <div id="projects">
            <h2>projects</h2>
            <ProjectComponent
                link="pomodoro"
            image ={airplane}
            title="Pomodoro"
            category="React.js| UX/UI"/>
        </div>
    )
}

export default Projects;
